import Link from 'next/link';

const linkStyle = {
    marginRight : 15,
};

const Header = () => (
    <div>
        <Link href="/">
            <a style={linkStyle}>Home</a>
        </Link>
        <Link href="/about">
            <a style={linkStyle}>About</a>
        </Link>
        <Link href="/">
            <a style={linkStyle}>Login</a>
        </Link> 
        <style jsx>{`
        h1,
        a {
          font-family: 'Arial';
          text-decoration: none;
          color: blue;
        }

        a:hover {
          opacity: 0.6;
        }
      `}</style>
    </div>
)

export default Header;
